  <style rel="stylesheet" crossorigin>body{margin:0;padding:0;font-family:-apple-system,BlinkMacSystemFont,Segoe UI,Arial,sans-serif}#main-container{display:flex;flex-direction:column;height:100vh}#controls{background:#f5f5f5;padding:12px;border-bottom:1px solid #ddd;display:flex;gap:10px;align-items:center;flex-wrap:wrap}#content-container{display:flex;flex:1;overflow:hidden;position:relative}#filter-panel{width:280px;background:#f9f9f9;border-right:1px solid #ddd;padding:15px;overflow-y:auto;transition:margin-left .3s ease;flex-shrink:0}#filter-panel.collapsed{margin-left:-280px}#cy-container{flex:1;position:relative;background:#fff}#cy{width:100%;height:100%}button{padding:8px 16px;background:#fff;border:1px solid #ccc;border-radius:4px;cursor:pointer;font-size:14px}button:hover{background:#e9e9e9}button:active{background:#d9d9d9}button.primary{background:#1976d2;color:#fff;border-color:#1976d2}button.primary:hover{background:#1565c0}#toggle-filters{font-size:18px;padding:8px 12px;font-weight:700}#info{font-size:14px;color:#666;margin-left:auto}.filter-section{margin-bottom:20px;padding-bottom:15px;border-bottom:1px solid #ddd}.filter-section:last-child{border-bottom:none}.filter-section h3,.filter-section h4{margin:0 0 10px;font-size:14px;font-weight:600;color:#333}.filter-section label{display:block;margin:8px 0;cursor:pointer;font-size:13px}.filter-section input[type=checkbox]{margin-right:6px}.filter-section input[type=text],.filter-section select{width:100%;padding:6px 8px;border:1px solid #ccc;border-radius:4px;font-size:13px;box-sizing:border-box}.filter-section small{display:block;margin-top:4px;color:#666;font-size:11px}#distance-slider{width:100%;margin:8px 0}#distance-value{font-weight:700;color:#1976d2}.module-chips{min-height:30px;margin-bottom:8px}.module-chip{display:inline-block;background:#1976d2;color:#fff;padding:4px 8px;border-radius:12px;margin:2px;font-size:11px}.module-chip .remove{margin-left:6px;cursor:pointer;font-weight:700}.module-chip .remove:hover{color:#fcc}.filter-actions{display:flex;gap:8px;margin-top:15px}.filter-actions button{flex:1}.context-menu{position:absolute;background:#fff;border:1px solid #ccc;border-radius:4px;box-shadow:0 2px 8px #00000026;z-index:10000;min-width:150px}.context-menu-item{padding:8px 12px;cursor:pointer;font-size:13px;border-bottom:1px solid #f0f0f0}.context-menu-item:last-child{border-bottom:none}.context-menu-item:hover{background:#f5f5f5}.layout-setting{margin:8px 0}.layout-setting label{display:block;margin-bottom:4px;font-size:12px;color:#555}.layout-setting select,.layout-setting input[type=number]{width:100%;padding:6px 8px;border:1px solid #ccc;border-radius:4px;font-size:13px;box-sizing:border-box}.layout-setting input[type=checkbox]{margin-left:0;cursor:pointer}.advanced-settings-section{margin-top:12px}.advanced-toggle{display:flex;align-items:center;gap:6px;padding:8px;background:#f0f0f0;border-radius:4px;cursor:pointer;font-size:12px;font-weight:600;color:#555;user-select:none}.advanced-toggle:hover{background:#e5e5e5}.toggle-icon{font-size:10px;width:12px}.advanced-settings-content{margin-top:8px;padding-left:8px}#legend{position:absolute;bottom:20px;right:20px;background:#fff;padding:15px;border-radius:8px;box-shadow:0 2px 8px #00000026;font-size:13px;z-index:1000}#legend h4{margin:0 0 10px;font-size:14px;font-weight:600}.legend-item{display:flex;align-items:center;gap:8px;margin:6px 0}.legend-shape{width:20px;height:20px;border:2px solid #999}.legend-shape.module{background:#90caf9;border-radius:50%}.legend-shape.script{background:#a5d6a7;border-radius:2px}.legend-shape.namespace{background:#ffcc80;border-radius:2px;border-style:dashed}</style>

<body>
    <div id="main-container">
        <div id="controls">
            <button id="toggle-filters">☰ Toggle Filters</button>
            <button id="fit">Fit to Screen</button>
            <button id="reset-zoom">Reset Zoom</button>
            <button id="center">Center</button>
            <button id="export-png">Export as PNG</button>
            <span id="info"></span>
        </div>
        <div id="content-container">
            <div id="filter-panel">
                <h3>Filters</h3>
                <div class="filter-section">
                    <h4>Display Options</h4>
                    <label>
                        <input type="checkbox" id="show-orphans" checked>
                        Show orphan nodes
                    </label>
                    <label>
                        <input type="checkbox" id="show-namespaces" checked>
                        Show namespace packages
                    </label>
                    <label>
                        <input type="checkbox" id="highlighted-only" checked>
                        Show only highlighted nodes
                    </label>
                </div>

                <div class="filter-section">
                    <h4>Distance Filter</h4>
                    <label>
                        Max distance: <span id="distance-value">∞</span>
                        <input type="range" id="distance-slider" min="0" max="10" value="10">
                    </label>
                </div>

                <div class="filter-section">
                    <h4>Upstream Dependencies</h4>
                    <div id="upstream-modules"></div>
                    <button id="add-upstream">Add Module</button>
                </div>

                <div class="filter-section">
                    <h4>Downstream Dependents</h4>
                    <div id="downstream-modules"></div>
                    <button id="add-downstream">Add Module</button>
                </div>

                <div class="filter-section">
                    <h4>Exclude Scripts</h4>
                    <input type="text" id="exclude-patterns" placeholder="*pattern*">
                    <small>Use wildcards: *prefix, suffix*, *substring*</small>
                </div>

                <div class="filter-section">
                    <h4>Layout Algorithm</h4>
                    <select id="layout-select">
                        <option value="dagre">Dagre (hierarchical)</option>
                        <option value="cose">CoSE (force-directed)</option>
                        <option value="cose-bilkent">CoSE-Bilkent (enhanced)</option>
                        <option value="cola">Cola (constraints)</option>
                        <option value="elk">ELK (Eclipse)</option>
                        <option value="breadthfirst">Breadth-first</option>
                        <option value="circle">Circle</option>
                        <option value="grid">Grid</option>
                        <option value="concentric">Concentric</option>
                    </select>
                    <div id="layout-settings"></div>
                    <button id="apply-layout">Apply Layout</button>
                </div>

                <div class="filter-actions">
                    <button id="reset-filters">Reset to Original</button>
                    <button id="apply-filters" class="primary">Apply Filters</button>
                </div>
            </div>
            <div id="cy-container">
                <div id="cy"></div>
                <div id="legend">
                    <h4>Legend</h4>
                    <div class="legend-item">
                        <span class="legend-shape module"></span> Module
                    </div>
                    <div class="legend-item">
                        <span class="legend-shape script"></span> Script
                    </div>
                    <div class="legend-item">
                        <span class="legend-shape namespace"></span> Namespace
                    </div>
                </div>
            </div>
        </div>
    </div>

    <div id="context-menu" class="context-menu" style="display: none;">
        <div class="context-menu-item" data-action="add-upstream">Add to upstream</div>
        <div class="context-menu-item" data-action="add-downstream">Add to downstream</div>
        <div class="context-menu-item" data-action="remove">Remove from filters</div>
    </div>

    <script>
        // Data placeholder (replaced by Rust CLI at build time)
        window.__GRAPH_DATA__ = <!--GRAPH_DATA_PLACEHOLDER-->;
    </script>
</body>
</html>
